import React from 'react'
import { Card, Avatar } from 'antd'
const { Meta } = Card

function UserProfile() {
  return (
    <Card
      actions={[
        <>
          <div key='jackjack'>jack</div>
          <div key='follower'>follwer</div>
          <div key='follwing'>follwing</div>
        </>,
      ]}
    >
      <Meta title='Hyoje Profile' avatar={<Avatar>hyojelee</Avatar>} />
    </Card>
  )
}

export default UserProfile
